function verificar() {
    var data = new Date()
    var ano = data.getFullYear()
    var fAno = document.getElementById('txtano')
    var res = document.getElementById('res')

    if(fAno.value.length == 0 || fAno.value > ano) {
        window.alert('Verifique os seus dados e tente novamente !')
    }else{
        var fsex = document.getElementsByName('radsex')
        var idade = ano - Number('fAno')
        var genero = ''
        var img = document.createElement('img')
        img.setAttribute('id', 'foto')
        if(fsex[0].checked ) {
            genero = 'Masculino'
            if(idade >=0 && idade < 18){
                //crianÃ§a
                img.setAttribute(src="data:image/jpeg;base64,")
            }else if (idade >=10 && idade < 21){
                // jovem
                img.setAttribute(src="data:image/jpeg;base64,")
            }else if(idade < 50){
                //adulto
                img.setAttribute(src="data:image/jpeg;base64,")
            }else{
                //idoso
                img.setAttribute(src="data:image/jpeg;base64,")
            }
        }else if (fsex[1].checked){
            genero ='feminino'
            if(idade >=0 && idade < 18){
                //crianÃ§a
                img.setAttribute(src="data:image/jpeg;base64,")
            }else if (idade >=10 && idade < 21){
                // jovem
                img.setAttribute(src="data:image/jpeg;base64,")
            }else if(idade < 50){
                //adulto
                img.setAttribute(src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcRUirhWhmFuv98UbyNylnbGNWQefF8eEzWAIg&usqp=CAU")
            }else{
                //idoso
                img.setAttribute(src="https://encrypted-tbn0.gstatic.com/images?q=tbn:ANd9GcR3zll8Uevn7gMAuzPgo_hbWsieqVeIfHq97Q&usqp=CAU")
            }
        }
        res.style.textAlign = 'center'
        res.innerHTML = `VocÃª Ã© ${genero} com ${idade} anos.`
        res.appendChild(img)
    }
}